import React from 'react';
import { Link } from 'react-router-dom';

const AboutMe = () => {
    return (
        <section className="app__about" idFor="top">
        <div className="products__wrapper">
            <Link to="/" class="link--back">Volver</Link>
        <p>Rosatito</p>
        </div>
        </section>
    );
}

export default AboutMe;
